import React from 'react';
import AuthMiddleware from './middleware/AuthMiddleware'

const Home = React.lazy(() => import('./views/backend/Home'));
const AdminIndex = React.lazy(() => import('./views/backend/admin/Index'));
const AdminCreate = React.lazy(() => import('./views/backend/admin/Create'));
const CityIndex = React.lazy(() => import('./views/backend/city/index'));
const AmenityIndex = React.lazy(() => import('./views/backend/amenity/index'));

// https://github.com/ReactTraining/react-router/tree/master/packages/react-router-config
const routes = [
  { path: '/', exact: true, name: 'Home',component:Home,middleware:AuthMiddleware},
];

export default routes;
